import React from 'react';
import SmallCardPanel from './SmallCardPanel';
import NotePanel from './NotePanel';
import Navbar from './Navbar';
import './App.css';

function App (){
	return (
		<div>
			<Navbar />
			<SmallCardPanel />
			<NotePanel />
		</div>
	);
}

export default App;
